import logo from './logo.svg';
import './App.css';

function Square() {
    return <button className="square">X</button>;
}

export default function Board() {
    return (
        <>
            <div className="borard-row">
                <Square/>
                <Square />
                <button className="square">X</button>
            </div>
            <div className="borard-row">
                <button className="square">X</button>
                <button className="square">X</button>
                <button className="square">X</button>
            </div>
            <div className="borard-row">
                <button className="square">X</button>
                <button className="square">X</button>
                <button className="square">X</button>
            </div>
        </>
    );
}

